using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using Epam.FinalTask.PhotoAlbum.DAL.Contracts;
using Epam.FinalTask.PhotoAlbum.Entities;

namespace Epam.FinalTask.PhotoAlbum.FakeDAL
{
    public class FakeImagesDao : IImagesDao
    {
        private static readonly int bannedId = 1;
        private static int id = 2;

        private readonly ICommentsDao commentsDao;

        private List<Image> images;

        public FakeImagesDao(ICommentsDao commentsDao)
        {
            this.commentsDao = commentsDao;

            this.images = new List<Image>
            {
                new Image
                {
                    ImageOwner = new User
                    {
                        UserId = 0,
                    },
                    ImageId = bannedId,
                    MimeType = "image/jpeg",
                    ImageData = "",
                    ImageDateOfUpload = DateTime.MinValue,
                }
            };
        }

        public bool Add(Image image)
        {
            try
            {
                image.ImageId = id++;
                this.images.Add(image);
                return true;
            }
            catch (Exception)
            {
                return false;
            }
        }

        public Image GetBannedImage()
        {
            return this.images.FirstOrDefault(i => i.ImageId == bannedId);
        }

        public Image GetImageById(int imageId)
        {
            Image image = this.images.FirstOrDefault(i => i.ImageId == imageId);

            image.Comments = this.commentsDao.GetCommentsForImage(image.ImageId);

            return image;
        }

        public IEnumerable<Image> GetUserImages(int userId)
        {
            return this.images.Where(i => i.ImageOwner.UserId == userId).ToArray();
        }

        public void SetBannedImage(Image image)
        {
            image.ImageId = bannedId;
            this.images[0] = image;
        }
    }
}
